import React from 'react'

export const Navbar = () => {
  return (
    <div className='fixed top-0 w-full h-[100px] flex justify-between py-6'>
      <span className='logo'>Bilan Mykhailo</span>
      <div className="flex justify-between gap-4 mx-10">
        <a href="#">Homepage</a>
        <a href="#">About</a>
        <a href="#">Contact</a>
      </div>
    </div>
  )
}
